			RiverBearFish.addChild(waterFall);
			waterFall.x = 581;
			waterFall.y = 311;
		
			var bear1 = new lib.bear(); //הוספת הדב באופן דינאמי לבמה
			RiverBearFish.addChild(bear1);
			bear1.name = "biggerBear";
