		function startGame() {
		
			gameLength = qArray[gameNum].length; //הוצאת מספר השאלות במשחק שנבחר למשתנה גלובאלי
			stage.removeChild(stage.getChildByName("combo")); //מוחק את הקומבו
			stage.removeChild(stage.getChildByName("wellcome")); //מחיקת הטקסט
			self.instructionPic.visible = false; //הסתרת הוראה לתמונות
			self.progressBar.visible = true; //הצגת ציר ההתקדמות
			self.progressBar.gotoAndStop(prosses);
			self.progressTxt.visible = true; //הצגת הטקסט בציר ההתקדמות
			self.progressTxt.text = countTrue + "/" + gameLength;
		
			var rndQ = Math.floor((Math.random() * (qArray[gameNum].length + 0))); //הגרלת השאלה מהמערך
			randomQNum = rndQ; //הוצאת המספר למשתנה הגלובאלי
		
			if (qArray[gameNum][rndQ][0] == true) { //תנאי שבודק האם השאלה שהוגרלה נענתה. אם נענתה נכון שיגריל שוב
				startGame();
			} else {
		
				timer();
				var QandA = new createjs.Container(); //הכנסת השאלה והתשובות לתוך קונטיינר כדי שיהיה קל למחוק אותם אחר כך ולעבור לשאלה הבאה
				stage.addChild(QandA);
				QandA.name = "QnA";
				self.choose.visible = true;//הצג הוראות לשאלה
				self.choose.text = "בחרו את התשובה הנכונה"
				self.choose.font = "18px Arial";
		
				if (qArray[gameNum][rndQ][1].length == 2) { //אם המערך של השאלה מכיל 2 תאים בתוכו
					var picQtext = new createjs.Text(); //טקסט שאלה
					QandA.addChild(picQtext);
					picQtext.text = qArray[gameNum][rndQ][1][0];
					picQtext.font = "18px Arial";
					picQtext.textAlign = "right";
					picQtext.lineWidth = 500;
					picQtext.x = 920;
					picQtext.y = 90;
					
					var picStr = qArray[gameNum][rndQ][1][1].toString(); //משתנים שעוזרים לזהות תמונה
					var ansStr = picStr.substring(0, 8);
					if (ansStr == 'function') {
						var picQ = new qArray[gameNum][rndQ][1][1];
						QandA.addChild(picQ);
						picQ.x = 240;
						picQ.y = 50;
						picQ.addEventListener("mouseover", mouseOverPicQ);
						picQ.addEventListener("mouseout", mouseOutPicQ);
						self.instructionPic.visible = true;//הצג הוראות לתמונה
						self.instructionPic.text = "להגדלת התמונה עברו מעליה עם העכבר*";
						self.instructionPic.font = "18px Arial";
					}
				} else { //אם המערך של השאלה מורכב מתא אחד
		
					var Qtxt = new createjs.Text(); //טקסט שאלה
					QandA.addChild(Qtxt);
					Qtxt.text = qArray[gameNum][rndQ][1]; //הוספת השאלה שהוגרלה
					Qtxt.font = "18px Arial";
					Qtxt.textAlign = "right";
					Qtxt.lineWidth = 500;
					Qtxt.x = 920;
					Qtxt.y = 90;
					
				}
		
				var randAnsArr = []; //מערך חדש לתשובות
		
				for (z = 0; z < qArray[gameNum][rndQ][2].length; z++) {
					randAnsArr[z] = qArray[gameNum][rndQ][2][z]; //הזרקת שורת התשובות למערך
				}
		
				var randAns = Math.floor((Math.random() * (randAnsArr.length + 0)));
		
				for (i = 0; i < qArray[gameNum][rndQ][2].length; i++) { //יצירת המסיחים
		
					var answerBtn = new lib.mesiah();
					QandA.addChild(answerBtn);
					answerBtn.gotoAndStop(0); //בתוך הכפתור יש כמה פריימים. אנחנו מפנים אותו לפריים הרלוונטי
					answerBtn.x = 200 * i + 185; // מיקום כפתורי המסיחים
					answerBtn.y = 200;
					answerBtn.name = "ans" + i;
					stage.enableMouseOver(answerBtn); //הוספת האפשרות לליסנר של מעבר עכבר
					answerBtn.addEventListener("mouseover", mouseOverAns);
					answerBtn.addEventListener("mouseout", mouseOutAns);
					answerBtn.addEventListener("click", clickAns);
		
					var picString = randAnsArr.toString(); //משתנים שעוזרים לזהות תמונה
					var ansString = picString.substring(0, 8);
		
					if (ansString == 'function') { // התנהגות למסיח תמונה
						var picAns = new(randAnsArr[randAns]);
						answerBtn.addChild(picAns);
						picAns.name = "pic" + i;
						picAns.addEventListener("mouseover", mouseOverPic);
						picAns.addEventListener("mouseout", mouseOutPic);
						self.instructionPic.visible = true;//הצג הוראות לתמונה
						self.instructionPic.text = "להגדלת התמונות עברו מעליהן עם העכבר*";
						self.instructionPic.font = "18px Arial";
					} else { //התנהגות למסיח טקסט
						var txtAns = new createjs.Text(); //יצירת תיבת טקסט
						answerBtn.addChild(txtAns);
						txtAns.text = randAnsArr[randAns]; //הטקסט של המסיחים מהמערך
						txtAns.font = "18px Arial";
						txtAns.lineWidth = 150;
						txtAns.textAlign = "center";
					}
		
					if (randAnsArr[randAns] == qArray[gameNum][rndQ][2][0]) { //הפיכת התשובה הנכונה לגלובאלית
						correctAns = "ans" + i;
					}
		
					if (qArray[gameNum][rndQ][2].length == 3) { //שינוי מיקומי המסיחים בהתאם לכמות שלהם
						answerBtn.x = 210 * i + 270;
					}
					if (qArray[gameNum][rndQ][2].length == 2) {
						answerBtn.x = 220 * i + 370;
					}
					if (qArray[gameNum][rndQ][2].length == 5) {
						answerBtn.x = 180 * i + 120;
					}
					randAnsArr.splice(randAns, 1); //ערבול מסיחים במערך התשובות
					randAns = Math.floor((Math.random() * (randAnsArr.length + 0)));
		
				}}}
		
		function timer() {
			
			var time = new lib.clock;
			stage.addChild(time);
			time.x = 480;
			time.y = 338.65;
			time.name="clock";
			var timeTxt = new createjs.Text(); 
			time.addChild(timeTxt);
			timeTxt.text= "25";
			timeTxt.font="18px Arial";
			timeTxt.textAlign = "center";
			
			TimeOut = setInterval(function(){
			timeTxt.text= parseInt(timeTxt.text) - 1;
			countSec++; 
		
				if (countSec == 60) {
					countSec = 0;
					countMin++;
				}
				
					if (timeTxt.text== 0) {//כאשר הזמן נגמר
					stage.removeChild(stage.getChildByName("QnA")); //מנקה את השאלה והמסיחים
					stage.removeChild(stage.getChildByName("clock")); //מחיקת השעון
					self.choose.visible = false; //הסתרת הוראה לשאלות
					self.instructionPic.visible = false; //הסתרת הוראה לתמונות
						
					var continueBtn = new lib.btn();
					stage.addChild(continueBtn); //הוספת כפתור המשך
					continueBtn.x = 480;
					continueBtn.y = 400;
					continueBtn.name = "continue";
					var continueText = new createjs.Text(); //יצירת תיבת טקסט
					continueBtn.addChild(continueText);
					continueText.text = "המשך";
					continueText.textAlign = "center";
					continueText.font = "12px Arial";
					continueBtn.addEventListener("click", clean);
						
					var timeOutText = new createjs.Text();
			        stage.addChild(timeOutText);
					timeOutText.text="אופס.. נגמר הזמן ודובי שלנו רעב. בהצלחה בניסיון הבא";
					timeOutText.name="timeOut"
					timeOutText.x=480;
					timeOutText.y=300;
					timeOutText.font = "18px Arial";
					timeOutText.textAlign = "center";
					
					countAttempts++;//העלאת נסינות המענה באחד - שאלה שלא הספיקו לענות עליה נחשבת שגויה
					
					clearInterval(TimeOut);
				}}, 1000);
		}
		
		function mouseOverAns(evt) { //מעבר עכבר מעל מסיחים מסוג טקסט
			
			evt.currentTarget.gotoAndStop(1);
		}
		
		function mouseOutAns(evt) {
		
			evt.currentTarget.gotoAndStop(0);
		}
		
		function mouseOverPicQ(evt) { //מעבר עכבר מעל תמונה בשאלה
			evt.currentTarget.scaleX = 2;
			evt.currentTarget.scaleY = 2;
			evt.currentTarget.x = 180;
			evt.currentTarget.y = 20;
		}
		
		function mouseOutPicQ(evt) {
			evt.currentTarget.scaleX = 1;
			evt.currentTarget.scaleY = 1;
			evt.currentTarget.x = 240;
			evt.currentTarget.y = 50;
		}
		
		function mouseOverPic(evt) { //מעבר עכבר מעל תמונה במסיחים
			evt.currentTarget.scaleX = 1.7;
			evt.currentTarget.scaleY = 1.7;
			evt.currentTarget.y = -30;
		}
		
		function mouseOutPic(evt) {
			evt.currentTarget.scaleX = 1;
			evt.currentTarget.scaleY = 1;
			evt.currentTarget.y = 0;
		}
		
		function clickAns(evt) {
		
		       clearInterval(TimeOut);  
			
			for (i = 0; i < qArray[gameNum][randomQNum][2].length; i++) { //לולאה שעוברת על כל המסיחים, מאפסת אותם ומוחקת את הליסנרים
				stage.getChildByName("QnA").getChildByName("ans" + i).gotoAndStop(0);
				stage.getChildByName("QnA").getChildByName("ans" + i).removeEventListener("click", clickAns);
				stage.getChildByName("QnA").getChildByName("ans" + i).removeEventListener("mouseout", mouseOutAns);
				stage.getChildByName("QnA").getChildByName("ans" + i).removeEventListener("mouseover", mouseOverAns);
			}
		
			if (evt.currentTarget.name == correctAns) { //בדיקה האם התשובה נכונה
				evt.currentTarget.gotoAndStop(4); //התנהגות כפתור המסיח
				stage.getChildByName("RBF").getChildByName("biggerBear").gotoAndPlay(1); //הפעלת אנימציה של הדב
				stage.getChildByName("RBF").getChildByName("fish" + 5).gotoAndPlay(1); //הפעלת אנימציה של הדג
				qArray[gameNum][randomQNum][0] = true; //הפיכת התשובה לנכונה במערך
				countTrue++;
				countAttempts++;
				prosses = parseInt(countTrue / gameLength * 100);
				self.progressBar.gotoAndStop(prosses); //קידום ציר ההתקדמות
				self.progressTxt.text = countTrue + "/" + gameLength;		
			} 
			else { //אם התשובה לא נכונה
				evt.currentTarget.gotoAndStop(3); //התנהגות המסיח
				stage.getChildByName("RBF").getChildByName("biggerBear").gotoAndPlay(1); //הפעלת אנימציה של הדב
				stage.getChildByName("RBF").getChildByName("fish" + 4).gotoAndPlay(1); //הפעלת האנימציה של הדג
				countAttempts++;
			}
		
			var t1 = setTimeout(function() {
				if (evt.currentTarget.name == correctAns) {//בתנאי שהתשובה נכונה שהדב יגדל רק לאחר תפיסת הדג
					stage.getChildByName("RBF").getChildByName("biggerBear").scaleX = 1 + countTrue / gameLength; //הגדלת הדב באופן יחסי לפי מספר השאלות
					stage.getChildByName("RBF").getChildByName("biggerBear").scaleY = 1 + countTrue / gameLength;
				}
				
				var t2 = setTimeout(function () {//הופעת כפתור המשך רק לאחר שהאנימציה מסתיימת
					var continueBtn = new lib.btn();
					stage.addChild(continueBtn); //הוספת כפתור המשך
					continueBtn.x = 480;
					continueBtn.y = 400;
					continueBtn.name = "continue";
					var continueText = new createjs.Text(); //יצירת תיבת טקסט
					continueBtn.addChild(continueText);
					continueText.text = "המשך";
					continueText.textAlign = "center";
					continueText.font = "12px Arial";
					continueBtn.addEventListener("click", clean);
				}, 500);
				}, 1800);
		}
		
		function clean() {
			stage.removeChild(stage.getChildByName("clock")); //מחיקת השעון
			stage.removeChild(stage.getChildByName("continue")); //מחיקת כפתור המשך
			stage.removeChild(stage.getChildByName("QnA")); //מנקה את השאלה והמסיחים
			stage.removeChild(stage.getChildByName("timeOut"));//מנקה הודעה על תום הזמן
		
			if (countTrue == qArray[gameNum].length) { //אם כל השאלות נענו תפנה לפוקציית הפידבק
				finalFeedback();
			} else { //אם לא כל השאלות נענו תחזור למשחק
				startGame();
			}}
		
